import React, { Component } from "react";
import "./App.css";
import CardList from "./CardList";
import Card from "./Card";
import { robots } from "./Robots";

class App extends Component {
  render() {
    return (
      <div className="">
        <Card
          id={robots[0].id}
          name={robots[0].name}
          email={robots[0].email}
        ></Card>
        <Card
          id={robots[1].id}
          name={robots[1].name}
          email={robots[1].email}
        ></Card>
        <Card
          id={robots[2].id}
          name={robots[2].name}
          email={robots[2].email}
        ></Card>
      </div>
    );
  }
}

export default App;
